INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (769, CONCAT('Hime Chen! Otogi Chikku Idol Lilpri'), CONCAT('The Fairytale World is in trouble. Its princesses and their respective worlds are disappearing, causing a ripple effect in the human world where their stories are popular. In order to save the Fairytale World, the Queen sends three magic animals, Sei, Dai, and Ryoku, to the human world with magic gems to find three girls who can become the "Super Miracle Idols," the princesses Snow White, Cinderella, and Kaguya-hime. Those "princesses" end up being three little girls: Yukimori Ringo, Takashiro Layla, and Sasahara Natsuki. But the gems transform them into older singing superstars, and after their accidental debut at the singer Wish', CHAR(39), 's concert, they become known as "Little Princesses," or "LilPri." Now they must collect Happiness Tones from humans in order to restore the Fairytale World.'), 1, '2010-04-04', '2011-03-27', 'Spring 2010', '24 min. per ep.', 'https://cdn.myanimelist.net/images/anime/6/71891.jpg');
